import React, { Component } from 'react';
import { Navbar,Nav} from 'react-bootstrap';

import {BrowserRouter as Router,Route} from 'react-router-dom';
import Home from './Home.js';
import Galeria from './Galeria.js';
import './App.css';
  //import { Button } from 'react-bootstrap';

class App extends Component {
  constructor(props) {
   super(props);
   this.state = {
     loading: false,
     massage:""
   }
 }
 componetWildMount(){
   if(!this.state){
     this.setState= {
       loading:true,
       massage:"<p>Loading</>"

     }

   }
 }
 renderMesage(){
       <div><p>loading</p></div>
 }
  render() {
      return (
      <Router>
      <div className="App">
        <div className="App-header">
        <Navbar  fixed="top" bg="light" expand="md" >
          <Navbar.Brand href="home" className="title-nav">El Quijote</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="mr-auto ">
              <Nav.Link href="home">Inicio</Nav.Link>
              <Nav.Link href="/Galeria">Galeria</Nav.Link>
              <Nav.Link href="Paquetes">Paquetes</Nav.Link>
              <Nav.Link href="Contacto">Contacto</Nav.Link>
              <Nav.Link href="Acerca">Acerca de</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Navbar>
        </div>
        <div className="App-body">
        <Route path="/home" component={Home_page}/>
        <Route path="/Galeria" component={Galeria_page}/>
        </div>
      </div>

      </Router>
    )
  }
}
const Home_page = ({match}) => (
  <Home/>
)

const Galeria_page=({match}) =>(
  <Galeria/>
)
export default App;
